import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css';

const Home = () => {
	return (
		<div className="main">
			<h1>Home</h1>
			<Link to="/in-game">
				<button>To game</button>
			</Link>
		</div>
	);
};

export default Home;
